import React from 'react'	
import data from '../../assets/data/datas.json'

function Card (props) {
	data = props.data
	return (
				<div className='dataCard'>
					{data.map((data) =>
					<li key={ data.id }> 
					{ data.title }
					{ data.cover } alt={ data.title}
					</li>
					 )}

		</div>
)}
export default Card;
